import React from "react";

const SidebarMenu = () => {
  return (
    <div
      className="
    w-[300px] h-full bg-gray-300 
    fixed top-0 left-0 bottom-0 z-10 -translate-x-full
    shadow-md"
    ></div>
  );
};

export default SidebarMenu;
